import "./App.css";

function App() {

  const customStyles = {
    content: {
      top: "50%",
      left: "50%",
      right: "auto",
      bottom: "auto",
      marginRight: "-50%",
      transform: "translate(-50%, -50%)",
      height: "400px",
      width: "500px",
      overflow: "auto",
    },
  };

  return (
    <div>
      <h1>Kopa Samsu Store</h1>
    </div>
  );
}

export default App;
